CREATE TABLE IF NOT EXISTS `anagrafica` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `Cognome` VARCHAR(255), `Nome` VARCHAR(255), `NomeClasse` VARCHAR(255), `Credenziali` INTEGER);
CREATE TABLE IF NOT EXISTS `prenotazioni` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `IDAnagrafica` INTEGER, `IDMetodo` INTEGER, `OraConsumazione` TEXT);


